  const [count, setCount] = useState(0);

  const countIncrease=()=>{
    setCount(count +1);
  }
  return (
    <div className="App">
      <Navbar count = {count} />
      <ALLGun countIncrease = {countIncrease}></ALLGun>
    </div>
  );
}

export default App;
